$(document).ready(function(){$("#logout").click(function(e){console.log("logging out");window.location.href="../access/logout"});$("#loginButton").click(function(e){var t=$("#username").val();var n=$("#password").val();window.location.href="../access/login?u="+t+"&p="+n});$("#saveTextButton").click(function(e){console.log("saveTextButton clicked!");var t=$("#homepageText").val();$.ajax({type:"POST",url:"./saveHomepageMessage",data:{m:t}}).done(function(e){var t=e.search('"success":false');if(t===-1){console.log("success:true")}else{console.log("success:false")}})});$("#password").keypress(function(e){var t=$("#username").val();var n=$("#password").val();if(e.keyCode===13){window.location.href="../access/login?u="+t+"&p="+n}});$("#chooseDateToBlockOff").datepicker({minDate:0});$("#fromWholeDay").datepicker({minDate:0});$("#toWholeDay").datepicker({minDate:0});$("#blockOffTimeButton").click(function(e){var t=$("#chooseDateToBlockOff").val();var n=$("#fromHour").val();var r=$("#fromMinute").val();var i=$("#fromMorningOrAfternoon").val();var s=$("#toHour").val();var o=$("#toMinute").val();var u=$("#toMorningOrAfternoon").val();var a=n+":"+r+i;var f=s+":"+o+u;$("#blockOffTimeButton").html($("#waitingSpinner").html());$.ajax({type:"POST",url:"./blockOffTime",data:{date:t,from:a,to:f}}).done(function(e){var t=JSON.parse(e);if(t.success===true){console.log("success:true");$("#blockOffTimeButton").html("Success")}else{console.log("success:false");$("#blockOffTimeButton").html("Error")}})});$("#blockOffDaysButton").click(function(e){var t=$("#fromWholeDay").val();var n=$("#toWholeDay").val();$("#blockOffDaysButton").html($("#waitingSpinner").html());$.ajax({type:"POST",url:"./blockOffWholeDay",data:{from:t,to:n}}).done(function(e){var t=JSON.parse(e);if(t.success===true){console.log("success:true");$("#blockOffDaysButton").html("Success")}else{console.log("success:false");$("#blockOffDaysButton").html("Error")}})});$("#fourteenDayViewLink").click(function(e){e.preventDefault();var t=$("#fourteenDayViewLink").html();if(t==="14 day view"){$("#fourteenDayView-week1").fadeIn();$("#fourteenDayView-week2").fadeIn();$("#fourteenDayViewLink").html("Hide 14 day view")}else{$("#fourteenDayView-week1").fadeOut();$("#fourteenDayView-week2").fadeOut();$("#fourteenDayViewLink").html("14 day view")}})})